import Cookies from 'js-cookie';
export const verificarUsuario = () => {
    const sessionId = Cookies.get('session_UserID');
    if(sessionId != undefined){
        console.log("Todo bien" + `ID:${sessionId}`);
    }else{
        window.location();
        console.log("Usuario no logueado");
    }

};
